export class Quiz {
	constructor(quiz) {
		this.id = quiz.id;
		this.title = quiz.id;
		this.skills = quiz.id;
		this.numberOfQuestions = quiz.id;
		this.schedulingStatus = quiz.id;
		this.sechedule = quiz.id;
	}
}
